--  Procedure definition for `create_country`
-- ----------------------------
DROP PROCEDURE IF EXISTS `create_country`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `create_country`(IN country varchar(45),OUT country_id INT(11))
BEGIN
    DECLARE country_exists int;
    SET country_exists = 0;  
    SELECT count(*) INTO country_exists from lu_countries AS t WHERE t.country_name = country;   
 
    IF (country_exists > 0) THEN 
        #SELECT t.country_id FROM lu_countries AS t WHERE t.country_name = country;  
        SELECT t.country_id INTO country_id FROM lu_countries AS t WHERE t.country_name = country;  
		ELSE 
        #SELECT LAST_INSERT_ID() AS country_id;  
				SET country_id = LAST_INSERT_ID();
		END IF; 
END
;;
DELIMITER ;

