-- ----------------------------
--  Procedure definition for `create_year`
-- ----------------------------
DROP PROCEDURE IF EXISTS `create_year`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `create_year`(IN year_descr SMALLINT(4),OUT year_id INT(11))
BEGIN
    DECLARE year_exists int;
    DECLARE century int;
    DECLARE decade int;
    SET year_exists = 0;  
		SET century = (year_descr - (year_descr % 100))/100;
    SET decade = (year_descr % 100)/10;
    
    SELECT count(*) INTO year_exists from lu_years AS t WHERE t.year_descr = year_descr;   
 
    IF (year_exists > 0) THEN 
        #SELECT t.year_id  FROM lu_years AS t WHERE t.year_descr = year_descr;  
		SELECT t.year_id INTO year_id FROM lu_years AS t WHERE t.year_descr = year_descr;  
    ELSE 
        #SELECT LAST_INSERT_ID() AS year_id;
				SET year_id = LAST_INSERT_ID();
    END IF; 
END
;;
DELIMITER ;

-- ----------------------------
--  Procedure definition for `INSERT_ENERGY_RECORD`
-- ----------------------------
DROP PROCEDURE IF EXISTS `INSERT_ENERGY_RECORD`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `INSERT_ENERGY_RECORD`(IN target_table varchar(45), IN country varchar(45),IN year_descr SMALLINT(4),IN total varchar(45),IN per_person varchar(45),IN measure varchar(45))
BEGIN
DECLARE country_id INT;
DECLARE year_id INT;
DECLARE measure_id INT;

CALL create_country(country,country_id);
CALL create_year(year_descr,year_id);
CALL create_measure(measure,measure_id);

SELECT country_id,year_id,measure_id;

SET @query_ex = CONCAT("INSERT INTO ",target_table," (country_id,year_id,total,per_person,measure_id) VALUES (",country_id,",",year_id,",",total,",",per_person,",",measure_id,")");


PREPARE not_prefixed FROM @query_ex;
EXECUTE not_prefixed;

DEALLOCATE PREPARE not_prefixed;
END
;;
DELIMITER ;

